import logo from './logo.svg';
import './App.css';
import {useEffect, useState} from 'react';

// Import web3
const Web3 = require('web3').default;
const web3 = new Web3("http://127.0.0.1:8545"); // Adjust to your provider (e.g., Ganache or Infura URL)

// Contract ABI and Address
const contractABI = require('./DecentraAid.json').abi;
const contractAddress = "0x5dB268CCfd727CFfe2e1d598b8A76F872E0EFabE";
const Contract = new web3.eth.Contract(contractABI, contractAddress);

async function getHours() {
	try{
	      const accounts = await window.ethereum.request({ method: 'eth_requestAccounts' });
      	      const account = accounts[0];


      	      const userHours = await Contract.methods.getHours().call({from: account, gas:500000, gasPrice: web3.utils.toWei('50', 'gwei')});
      	      document.getElementById("hoursOutput").innerHTML = "Hours: " + userHours;

      	      console.log(userHours);
	}catch(error){

		console.error("Error Getting Hours: ", error);
	}
}

async function getAttendance() {

	try{
	      const accounts = await window.ethereum.request({ method: 'eth_requestAccounts' });
      	      const account = accounts[0];


      	      const userAttendance = await Contract.methods.getAttendanceRate().call({from: account, gas:500000, gasPrice: web3.utils.toWei('50', 'gwei')});
      	      document.getElementById("attendanceOutput").innerHTML = "Attendance: " + userAttendance;

	}catch(error){

		console.error("Error Getting Attendance: ", error);
	}



}

async function StartEvent() {
	try{
	      const accounts = await window.ethereum.request({ method: 'eth_requestAccounts' });
      	      const account = accounts[0];


      	      await Contract.methods.startEvent().send({from: account, gas:500000, gasPrice: web3.utils.toWei('50', 'gwei')});
      	      console.log("Event Started");

	}catch(error){

		console.error("Error Starting Event: ", error);
	}
}

async function EndEvent() {
	try{
	      const accounts = await window.ethereum.request({ method: 'eth_requestAccounts' });
      	      const account = accounts[0];


      	      await Contract.methods.endEvent().send({from: account, gas:500000, gasPrice: web3.utils.toWei('50', 'gwei')});
      	      console.log("Event Ended");

	}catch(error){

		console.error("Error Ending Event: ", error);
	}
}

async function signUps(name) {
	try{
	      const accounts = await window.ethereum.request({ method: 'eth_requestAccounts' });
      	      const account = accounts[0];


      	      await Contract.methods.signUp(name, "1").send({from: account, gas:500000, gasPrice: web3.utils.toWei('50', 'gwei')});
      	      console.log("Signing Up");

	}catch(error){

		console.error("Error Signing Up: ", error);
	}
}

async function userShow(name) {
	try{
	      const accounts = await window.ethereum.request({ method: 'eth_requestAccounts' });
      	      const account = accounts[0];


      	      await Contract.methods.show(name, "1").send({from: account, gas:500000, gasPrice: web3.utils.toWei('50', 'gwei')});
      	      console.log("User Show");

	}catch(error){

		console.error("Error Showing User: ", error);
	}
}

async function connect() {
    // Modern dapp browsers...
    console.log("Hello");
    //const account = document.getElementById("status");

      try {
        // Request account access

        console.log("Inside");
        if (window.ethereum) {
	  App.web3Provider = window.ethereum;
	  try {
	    // Request account access

	    await window.ethereum.enable();
	    //document.getElementById("status").innerHTML = "Connected";
	  } catch (error) {
	    // User denied account access...
	    console.error("User denied account access 0: ", error);
	  }

	  //account.innerHTML = 'Connected';
	}
      } catch (error) {
        // User denied account access...
        console.error("User denied account access 1: ", error);
      }

      const accounts = await window.ethereum.request({ method: 'eth_requestAccounts' });
      const account = accounts[0];
  	document.getElementById("status").innerHTML = `Connected to account: ${account}`;

}


function App() {

useEffect(() => {

	connect();

}, []);

const [signUpInputValue, setSignUpInputValue] = useState('');
const [showInputValue, setShowInputValue] = useState('');

  return (
